import React from "react";

function MemoDiv({memoElement,todoElement}){
    var memoKey = todoElement + "-" + memoElement;
    return(
        <div className="memoElement" key ={memoKey}>
            {memoElement}
        </div>
    )
}


function TodoMemoDivRender({renderList}){
    var returnList =[]
    var i=0;
    console.log(renderList);
    while(i<renderList.length){
        returnList.push(
        <div className="todoMainElement" key={renderList[i].todolist}>
            {renderList[i].todolist}
            {renderList[i].memolist.map(memoElement=>(
                <MemoDiv memoElement={memoElement} key={renderList[i].todolist}/>
            ))}
            {/* <MemoDiv memoList={renderList[i].memoList}></MemoDiv> */}
        </div>
        );

        i=i+1
    }
    return(
        returnList
    );
};

export default TodoMemoDivRender;
